import React, { Component } from "react";

class Footer extends Component {
  render() {
    return (
      <section className="section section-footer transparent">
        <div className="row">
          <p className="footer-copyright black-text left">
            Designed by Theophilus Okoye
          </p>
        </div>
      </section>
    );
  }
}

export default Footer;
